import React from 'react';
import styled from 'styled-components';

const SidebarContainer = styled.div`
  background-color: #212121;
  color: white;
  width: 250px;
  padding: 20px;
`;

const CalendarTitle = styled.h2`
  margin-bottom: 20px;
`;

const CalendarItem = styled.div`
  margin-bottom: 10px;
`;

function Sidebar() {
  return (
    <SidebarContainer>
      <CalendarTitle>이슈 캘린더</CalendarTitle>
      <CalendarItem>06월 11일 화요일</CalendarItem>
      <CalendarItem>06월 12일 수요일</CalendarItem>
      <CalendarItem>06월 15일 토요일</CalendarItem>
      {/* Add more calendar items as needed */}
    </SidebarContainer>
  );
}

export default Sidebar;
